static const int ktb = 0x0;
static const int kte = 0xf;

u32 FROR48(u32 x, int r)
{
    return ((x >> r) | (x << (24 - r)) & MASK24) & MASK24;
}

u32 FROL48(u32 x, int r)
{
    return ((x << r) | (x >> (24 - r)) & MASK24) & MASK24;
}

void sub_LEA48_KeyCheck(u32 *key_candidate, int key_candidate_count, int q, u32 *reduced_key, int *reduced_key_count)
{
    u32 x0, x1, y0, y1, z0, z1;
    int k, kkey, x, j, s, ts, l, b, bit, i;
    u32 state;
    
    WORD_TYPE p[2];
    WORD_TYPE c[2];

    int key_count = 0;

    u64 map[qpt]; 
    FILE *fp = fopen("Result_SPECK48.txt", "a");
    printf("------Partial Key Verification-----\n");  
    fprintf(fp, "------Partial Key Verification-----\n"); 

    u8 Input[qpt] = {0x0, 0x80, 0x40, 0x20, 0x10, 0x8, 0x4, 0x2, 0x1, 0xff};
    uint8_t Htrace[qpt][9];
    uint8_t temp;
    uint8_t trail[50][3];// Gaussian trail
    for(x = 0; x < qpt; x++)
    {
        Htrace[x][0] = 1;
        for(bit = 1; bit < 9; bit++)
        {
            if(Input[x] & idM8[bit - 1]) Htrace[x][bit] = 1;
            else Htrace[x][bit] = 0;
        }
    }
    int Gauss_time = 0; // 40
    //  Gaussian Elimination
    for(i = 0; i < 9; i++)
    {
        if(Htrace[i][i])
        {
            for(j = i + 1; j < qpt; j++)
            {
                if(Htrace[j][i])
                { 
                    for(int r = 0; r < 9; r++)
                    {
                        Htrace[j][r] ^= Htrace[i][r];
                    }
                    trail[Gauss_time][0] = 1; //addition
                    trail[Gauss_time][1] = j;
                    trail[Gauss_time][2] = i;
                    Gauss_time++;
                }
            }
        }
        else
        {
            int flag = 0;
            for(j = i + 1; j < qpt; j++)
            {
                if(Htrace[j][i])
                {
                    for(int r = 0; r < 9; r++)
                    {
                        temp = Htrace[i][r];
                        Htrace[i][r] = Htrace[j][r];
                        Htrace[j][r] = temp;
                    }
                    trail[Gauss_time][0] = 0; //swap
                    trail[Gauss_time][1] = j;
                    trail[Gauss_time][2] = i;
                    Gauss_time++;

                    flag = 1;
                    break;
                }
            }
            if(flag)
            {
                for(j = i + 1; j < qpt; j++)
                {
                    if(Htrace[j][i])
                    { 
                        for(int r = 0; r < 9; r++)
                        {
                            Htrace[j][r] ^= Htrace[i][r];
                        }
                        trail[Gauss_time][0] = 1; //addition
                        trail[Gauss_time][1] = j;
                        trail[Gauss_time][2] = i;
                        Gauss_time++;
                    }
                }
            }
        }
    }
    // printf("Gauss_time: %d\n", Gauss_time);
    // return ;

    // the rank of A
    int rA = qpt;
    for(i = qpt - 1; i >= 0; i--)
    {
        int allzero = 1;
        for(int j = 0; j < 9; j++)
        {
            if(Htrace[i][j]) allzero = 0;
        }
        if(allzero) rA--;
        else break;
    }
    // printf("rA: %d\n", rA);
    // return ;

    u32 key_guess[100] = {0};
    int k_max = 0;
    int knum = 0;
    uint8_t vector[qpt];
    for(s = 0; s < key_candidate_count; s++) // key
    {
        k = key_candidate[s];
        for(x = 0; x < qpt; x++) // adaptive inputs
        {
            x0 = (u32)(Input[x]) << ((q - 1) * 4);
            x1 = 0;
            
            y1 = FROR48(FROL48((x0 - x1) & MASK24, 8) ^ x1, 3);
            y0 = FROL48(((FROL48((x0 - x1) & MASK24, 8) ^ k) - y1) & MASK24, 8);
            
            p[0] = y0;
            p[1] = y1;
            map[x] = encrypt(p, c);
        }
        int k_count = 0;
        for(j = 0; j < tb48; j++) // samples of traces
        {
            for(x = 0; x < qpt; x++)
            { 
                if(j < 24)
                {    
                    if((map[x] >> 32) & idM24[j]) vector[x] = 1; // traces
                    else vector[x] = 0;
                }
                else
                {
                    if(map[x] & idM24[j - 24]) vector[x] = 1; // traces
                    else vector[x] = 0;
                }
            }
            //  Gaussian Elimination
            for(i = 0; i < Gauss_time; i++)
            {
                if(trail[i][0]) // addition
                {
                    vector[trail[i][1]] ^= vector[trail[i][2]];
                }
                else // swap
                {
                    temp = vector[trail[i][2]];
                    vector[trail[i][2]] = vector[trail[i][1]];
                    vector[trail[i][1]] = temp;
                }
            }
            
            // Gauss Over
            int rAb = qpt;
            for(i = qpt - 1; i >= 0; i--)
            {
                int allzero = 1;
                if(vector[i]) allzero = 0;
                if(allzero) rAb--;
                else break;
            }
            if(rA >= rAb) // has a solusion
            {
                k_count++;
            }
        }
        if(k_count && (k_count == k_max))
        {
            key_guess[knum] = k;
            knum++;
            // fprintf(fp, "key guess: %.2x, encoding count: %d\n", k, k_count);
            // printf("key guess: %.2x, encoding count: %d\n", k, k_count);
        }
        else if(k_count && (k_count > k_max))
        {
            k_max = k_count; 
            knum = 0;
            key_guess[knum] = k;
            knum++;
            // fprintf(fp, "key guess: %.2x, encoding count: %d\n", k, k_count);
            // printf("key guess: %.2x, encoding count: %d\n", k, k_count);
        }
    }
    fprintf(fp, "------\n");
    printf("------\n");
    for(k = 0; k < knum; k++)
    {
        fprintf(fp, "Verified key: %.2x, encoding count: %d\n", key_guess[k], k_max);
        printf("Verified key: %.2x, encoding count: %d\n", key_guess[k], k_max);
        reduced_key[k] = key_guess[k];
        key_count++;
    }
    *reduced_key_count = key_count;
    fprintf(fp, "------\n");
    printf("------\n");

    fprintf(fp, "Verified key count: %d\n", key_count);
    printf("Verified key count: %d\n", key_count);
    fclose(fp); 
}
